            var map = L.map('map');

            L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
                maxZoom: 19,
                attribution: ' OpenStreetMap contributors'
            }).addTo(map);

            data.forEach(function(item) {
                var marker = L.marker([item., item.]).addTo(map);
                marker.bindPopup('<b>' + item. + '</b><br><a href="' + item.URL + '" target="_blank"></a><br><a href="' + item.1 + '" target="_blank">1</a><br><a href="' + item.2 + '" target="_blank">2</a>');
            });

            map.locate({setView: true, maxZoom: 16});

            function onLocationFound(e) {
                var radius = e.accuracy / 2;
                var locationMarker = L.circleMarker(e.latlng, {
                    radius: 8,
                    fillColor: "#ff7800",
                    color: "#000",
                    weight: 1,
                    opacity: 1,
                    fillOpacity: 0.8
                }).addTo(map);
                locationMarker.bindPopup("").openPopup();
            }

            function onLocationError(e) {
                alert(e.message);
            }

            map.on('locationfound', onLocationFound);
            map.on('locationerror', onLocationError);
        </script>
